(function($) {
    "use strict";

    //cover images
    $(".cover-image").each(function() {
        var attr = $(this).attr('data-image-src');

        if (typeof attr !== typeof undefined && attr !== false) {
            $(this).css('background', 'url(' + attr + ') center center');
        }
    });

    //cover image2
    $(".cover-image2").each(function() {
        var attr = $(this).attr('data-image-src');

        if (typeof attr !== typeof undefined && attr !== false) {
            $(this).css('background', 'url(' + attr + ') center center');
        }
    });

    //mCustomScrollbar
    $(".app-sidebar").mCustomScrollbar({
        theme: "minimal",
        autoHideScrollbar: true,
        scrollbarPosition: "outside"
    });

    //PAGE LOADING
    $(window).on("load", function(e) {
        $("#spinner").fadeOut("slow");
    })

    // tooltip
    $("[data-toggle='tooltip']").tooltip();

    // popover
    $('[data-toggle="popover"]').popover({
        container: 'body'
    });

    if ($('#ms-menu-trigger')[0]) {
        $('body').on('click', '#ms-menu-trigger', function() {
            $('.ms-menu').toggleClass('toggled');
        });
    }
    // ______________ BACK TO TOP BUTTON
    $(window).on("scroll", function(e) {
        if ($(this).scrollTop() > 0) {
            $('#back-to-top').fadeIn('slow');
        } else {
            $('#back-to-top').fadeOut('slow');
        }
    });
    $(document).on("click", "#back-to-top", function(e) {
        $("html, body").animate({
            scrollTop: 0
        }, 600);
        return false;
    });


    /*----SideBar----*/
    $(".app-sidebar a").each(function() {
        var pageUrl = window.location.href.split(/[?#]/)[0];
        if (this.href == pageUrl) {
            $(this).addClass("active");
            $(this).parent().addClass("active"); // add active to li of the current link
            $(this).parent().parent().prev().addClass("active"); // add active class to an anchor
            $(this).parent().parent().prev().click(); // click the item to make it drop
        }
    });


    /*----FullScreen----*/
    $(document).on("click", "#fullscreen-button", function toggleFullScreen() {
        if ((document.fullScreenElement !== undefined && document.fullScreenElement === null) || (document.msFullscreenElement !== undefined && document.msFullscreenElement === null) || (document.mozFullScreen !== undefined && !document.mozFullScreen) || (document.webkitIsFullScreen !== undefined && !document.webkitIsFullScreen)) {
            if (document.documentElement.requestFullScreen) {
                document.documentElement.requestFullScreen();
            } else if (document.documentElement.mozRequestFullScreen) {
                document.documentElement.mozRequestFullScreen();
            } else if (document.documentElement.webkitRequestFullScreen) {
                document.documentElement.webkitRequestFullScreen(Element.ALLOW_KEYBOARD_INPUT);
            } else if (document.documentElement.msRequestFullscreen) {
                document.documentElement.msRequestFullscreen();
            }
        } else {
            if (document.cancelFullScreen) {
                document.cancelFullScreen();
            } else if (document.mozCancelFullScreen) {
                document.mozCancelFullScreen();
            } else if (document.webkitCancelFullScreen) {
                document.webkitCancelFullScreen();
            } else if (document.msExitFullscreen) {
                document.msExitFullscreen();
            }
        }
    })

    /*----GlobalSearch----*/
    $(document).on("click", "[data-toggle='search']", function(e) {
        var body = $("body");

        if (body.hasClass('search-gone')) {
            body.addClass('search-gone');
            body.removeClass('search-show');
        } else {
            body.removeClass('search-gone');
            body.addClass('search-show');
        }
    });
    var toggleSidebar = function() {
        var w = $(window);
        if (w.outerWidth() <= 1024) {
            $("body").addClass("sidebar-gone");
            $(document).off("click", "body").on("click", "body", function(e) {
                if ($(e.target).hasClass('sidebar-show') || $(e.target).hasClass('search-show')) {
                    $("body").removeClass("sidebar-show");
                    $("body").addClass("sidebar-gone");
                    $("body").removeClass("search-show");
                }
            });
        } else {
            $("body").removeClass("sidebar-gone");
        }
    }
    toggleSidebar();
    $(window).resize(toggleSidebar);

    /*----CollapseableLeftMenu----*/
    $("[data-collapse]").each(function() {
        var me = $(this),
            target = me.data('collapse');

        me.click(function() {
            $(target).collapse('toggle');
            $(target).on('shown.bs.collapse', function() {
                me.html('<i class="ion ion-minus"></i>');
            });
            $(target).on('hidden.bs.collapse', function() {
                me.html('<i class="ion ion-plus"></i>');
            });
            return false;
        });
    });

    /*----Alerts----*/
    $(".alert-dismissible").each(function() {
        var me = $(this);

        me.find('.close').on("click", function(e) {
            me.alert('close');
        });
    });

    //star rating
    var ratingOptions = {
        selectors: {
            starsSelector: '.rating-stars',
            starSelector: '.rating-star',
            starActiveClass: 'is--active',
            starHoverClass: 'is--hover',
            starNoHoverClass: 'is--no-hover',
            targetFormElementSelector: '.rating-value'
        }
    };
    $(".rating-stars").ratingStars(ratingOptions);

    //Showmore
    $(function(e) {
        $('#container').showmore({
            closedHeight: 200,
            buttonTextMore: 'Show more',
            buttonTextLess: 'Close',
            buttonCssClass: 'showmore-button',
            animationSpeed: 0.5
        });
    });


    //horizontalmenu
    $("a[data-theme]").on("click", function(e) {
        $("head link#theme").attr("href", $(this).data("theme"));
        $(this).toggleClass('active').siblings().removeClass('active');
    });
    $("a[data-effect]").on("click", function(e) {
        $("head link#effect").attr("href", $(this).data("effect"));
        $(this).toggleClass('active').siblings().removeClass('active');
    });

    //Popup-chat
    $("#addClass").on("click", function(e) {
        $('#qnimate').addClass('popup-box-on');
    });

    $("#removeClass").on("click", function(e) {
        $('#qnimate').removeClass('popup-box-on');
    });


})(jQuery);

/****** to preview uploaded image ******/
function readURL(input, img_id) {
    if (input.files && input.files[0]) {
        var reader = new FileReader();
        var image_id = $('#' + img_id);
        reader.onload = function(e) {
            image_id.attr('src', e.target.result);

        };
        image_id.css("width", "260px");
        image_id.css("height", "261px");
        reader.readAsDataURL(input.files[0]);
    }
}
